import React, { useState } from 'react'
import { Card } from 'semantic-ui-react'

const src = './media/profile_pictures/default.jpg'

let profileImages = [
    'default.jpg', 'christian.jpg', 'daniel.jpg', 'elliot.jpg',
    'jenny.jpg', 'joe.jpg', 'steve.jpg', 'stevie.jpg'
]

const ProfileImage = ({ userImage }) => {
    //Will not show user image
    profileImages = profileImages.filter(image => {
        return image !== userImage
    })

    const handleOnClick = (event) => {
        console.log(event.target)
    }

    return (
        <div>
            <Card.Group itemsPerRow={10}>
                {profileImages.map(image => {
                    
                    return (
                        <Card
                            className="profile-update-image"
                            onClick={handleOnClick}
                            value={image}
                            raised
                            image={require(`./media/profile_pictures/large/${image}`)} 
                        />
                    )
                })}
            </Card.Group>
        </div>
    )
}

export default ProfileImage
